script: |
  super -f text -I q10046.spq | sort > q10046.out

inputs:
  - name: q10046.spq
    data: |
      SELECT - 34 + col1 + + col0 FROM tab2 (FORMAT parquet) WHERE NOT col0 - col2 BETWEEN col1 * col0 AND ( - CAST ( NULL AS INTEGER ) - - + col1 );
  - name: tab2

outputs:
  - name: q10046.out
    data: |
      107
      108
      63
